//import logo from './logo.svg';
import React, { Component } from "react";
import './App.css';

class TimerWindow extends Component { 
  constructor(props) {
    super(props);

    this.onPress = this.onPress.bind(this);
  }

  onPress() { 
    this.props.onVote(this.props.id);
  }

  render() {
    return (
      <div className='row'>
        <div className='column'>
          <button>BAKE</button>
        </div>
        <div className='column'>
        <div class="card">
          <div class="card-header">
            Bake Step Times
          </div>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">Mix Initial Ingredients: </li>
            <li className="list-group-item">Room Temp Rise: </li>
            <li className="list-group-item">Cold Rise:</li>
            <li className="list-group-item">Bring To Room Temp:</li>
            <li className="list-group-item">More Ingredients:</li>
            <li className="list-group-item">Rise Room Temp:</li>
            <li className="list-group-item">Proof:</li>
            <li className="list-group-item">Bake:</li>
            <li className="list-group-item">Cool time:</li>
          </ul>
        </div>
      </div> 
      </div>
    ); 
  }
} 

function App() {
  return (
    <div>
      <TimerWindow />
    </div>
  );
}

export default App;
